INSERT INTO `pages` (`id`, `title`, `slug`, `content`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'About', 'about', '<h2 data-start=\"129\" data-end=\"144\">Tentang Kami</h2>\r\n<p data-start=\"146\" data-end=\"350\"><strong data-start=\"146\" data-end=\"167\">SavePalestina.org</strong> adalah sebuah platform independen yang bertujuan untuk menyebarkan informasi, edukasi, dan kepedulian terhadap kondisi kemanusiaan yang terjadi di Gaza dan seluruh wilayah Palestina.</p>\r\n<p data-start=\"352\" data-end=\"560\">Kami percaya bahwa kekuatan informasi dapat menggerakkan empati dan aksi. Melalui situs ini, kami menghadirkan berbagai artikel, berita, dan kampanye solidaritas agar dunia tahu bahwa Palestina tidak sendiri.</p>\r\n<hr data-start=\"562\" data-end=\"565\">\r\n<h3 data-start=\"567\" data-end=\"582\">Misi Kami</h3>\r\n<ul data-start=\"583\" data-end=\"788\">\r\n<li data-start=\"583\" data-end=\"646\">\r\n<p data-start=\"585\" data-end=\"646\">Menyuarakan keadilan dan kemanusiaan bagi rakyat Palestina.</p>\r\n</li>\r\n<li data-start=\"647\" data-end=\"725\">\r\n<p data-start=\"649\" data-end=\"725\">Mengedukasi masyarakat tentang sejarah, kondisi, dan perjuangan Palestina.</p>\r\n</li>\r\n<li data-start=\"726\" data-end=\"788\">\r\n<p data-start=\"728\" data-end=\"788\">Menggalang dukungan dan solidaritas melalui kampanye online.</p>\r\n</li>\r\n</ul>\r\n<hr data-start=\"790\" data-end=\"793\">\r\n<h3 data-start=\"795\" data-end=\"812\">Siapa Kami?</h3>\r\n<p data-start=\"813\" data-end=\"1025\">Kami adalah sekelompok pemuda Indonesia yang peduli akan isu kemanusiaan, khususnya yang terjadi di tanah Palestina. Dengan latar belakang berbeda-beda, kami bersatu dalam satu visi: <strong data-start=\"996\" data-end=\"1024\">Keadilan untuk Palestina</strong>.</p>\r\n<hr data-start=\"1027\" data-end=\"1030\">\r\n<h3 data-start=\"1032\" data-end=\"1043\">Motto</h3>\r\n<p data-start=\"1044\" data-end=\"1141\"><em data-start=\"1044\" data-end=\"1141\">\"Tidak perlu menjadi Muslim untuk peduli Palestina. Cukup jadi manusia yang punya hati nurani.\"</em></p>', 1, '2025-06-13 12:47:26', '2025-06-13 21:29:27', NULL),
(2, 'Contact', 'contact', '<h3 data-start=\"175\" data-end=\"194\">üìû Hubungi Kami</h3><p data-start=\"196\" data-end=\"411\">Kami senang mendengar dari Anda! Jika Anda memiliki pertanyaan, kritik, saran, atau ingin berkontribusi dalam mendukung perjuangan rakyat Palestina, jangan ragu untuk menghubungi kami melalui informasi di bawah ini:</p><hr data-start=\"413\" data-end=\"416\"><h4 data-start=\"418\" data-end=\"440\">üì¨ Alamat Email</h4><p data-start=\"441\" data-end=\"544\"><strong data-start=\"441\" data-end=\"473\">‚úâÔ∏è <a data-start=\"446\" data-end=\"471\" class=\"cursor-pointer\" rel=\"noopener\">support@savepalestina.org</a></strong><br data-start=\"473\" data-end=\"476\">\r\nKami akan merespons email Anda dalam waktu 1√ó24 jam pada hari kerja.</p><hr data-start=\"546\" data-end=\"549\"><h4 data-start=\"551\" data-end=\"574\">‚òéÔ∏è Nomor Telepon</h4><p data-start=\"575\" data-end=\"644\"><strong data-start=\"575\" data-end=\"599\">üìû +62 821-3456-7890</strong><br data-start=\"599\" data-end=\"602\">\r\nTersedia Senin ‚Äì Jumat (09.00 ‚Äì 17.00 WIB)</p><hr data-start=\"646\" data-end=\"649\"><h4 data-start=\"651\" data-end=\"672\">üìç Lokasi Kami</h4><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p data-start=\"673\" data-end=\"733\">Jl. tangkul 1 No. 68, Sumatera Utara, Indonesia</p>', 1, '2025-06-13 12:51:48', '2025-06-13 21:26:19', NULL),
(3, 'Privacy', 'privacy', '<h2 data-start=\"121\" data-end=\"145\">üõ°Ô∏è Kebijakan Privasi</h2><p data-start=\"147\" data-end=\"270\">Kami menghargai privasi Anda dan berkomitmen untuk melindungi informasi pribadi yang Anda berikan saat mengakses situs ini.</p><h3 data-start=\"272\" data-end=\"300\">1. Pengumpulan Informasi</h3><p data-start=\"301\" data-end=\"469\">Kami dapat mengumpulkan informasi pribadi seperti nama, email, dan nomor telepon hanya ketika Anda secara sukarela mengirimkan melalui formulir kontak atau pendaftaran.</p><h3 data-start=\"471\" data-end=\"498\">2. Penggunaan Informasi</h3><p data-start=\"499\" data-end=\"547\">Informasi yang dikumpulkan akan digunakan untuk:</p><ul data-start=\"548\" data-end=\"675\">\r\n<li data-start=\"548\" data-end=\"592\">\r\n<p data-start=\"550\" data-end=\"592\">Menanggapi pertanyaan atau permintaan Anda</p>\r\n</li>\r\n<li data-start=\"593\" data-end=\"635\">\r\n<p data-start=\"595\" data-end=\"635\">Mengirimkan update terkait kampanye kami</p>\r\n</li>\r\n<li data-start=\"636\" data-end=\"675\">\r\n<p data-start=\"638\" data-end=\"675\">Meningkatkan layanan dan konten situs</p>\r\n</li>\r\n</ul><h3 data-start=\"677\" data-end=\"701\">3. Perlindungan Data</h3><p data-start=\"702\" data-end=\"860\">Kami menjaga informasi Anda dengan langkah-langkah keamanan teknis dan administratif yang sesuai untuk melindungi dari akses atau pengungkapan yang tidak sah.</p><h3 data-start=\"862\" data-end=\"888\">4. Pembagian Informasi</h3><p data-start=\"889\" data-end=\"1032\">Kami tidak akan menjual, menyewakan, atau membagikan informasi pribadi Anda kepada pihak ketiga tanpa izin Anda, kecuali diwajibkan oleh hukum.</p><h3 data-start=\"1034\" data-end=\"1057\">5. Tautan Eksternal</h3><p data-start=\"1058\" data-end=\"1203\">Situs kami dapat mengandung tautan ke situs eksternal. Kami tidak bertanggung jawab atas kebijakan privasi atau konten dari situs-situs tersebut.</p><h3 data-start=\"1205\" data-end=\"1223\">6. Persetujuan</h3><p data-start=\"1224\" data-end=\"1292\">Dengan menggunakan situs ini, Anda menyetujui kebijakan privasi ini.</p><hr data-start=\"1294\" data-end=\"1297\"><h3 data-start=\"1299\" data-end=\"1325\">üîÑ Perubahan Kebijakan</h3><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p data-start=\"1326\" data-end=\"1412\">Kebijakan ini dapat diperbarui sewaktu-waktu. Perubahan akan diumumkan di halaman ini.</p>', 1, '2025-06-13 12:54:45', '2025-06-13 21:27:36', NULL);

