(1, 1, 'Gaza Palestina: Derita, Harapan, dan Perjuangan', 'gaza-palestina-derita-harapan-dan-perjuangan', 2, '<p data-start=\"1262\" data-end=\"1513\" style=\"text-align: justify;\">Gaza kembali menjadi saksi penderitaan luar biasa. Serangan demi serangan merenggut nyawa warga sipil tak berdosa, termasuk anak-anak dan perempuan. Blokade yang berlangsung selama bertahun-tahun memperburuk kondisi ekonomi, kesehatan, dan pendidikan.</p><p data-start=\"1518\" data-end=\"1722\" style=\"text-align: justify;\">Namun, di balik puing-puing kehancuran, rakyat Palestina tetap menunjukkan semangat perjuangan dan harapan yang luar biasa. Mereka tak hanya bertahan, tetapi juga terus membangun kembali kehidupan mereka.</p><p data-start=\"1727\" data-end=\"1912\" style=\"text-align: justify;\">Dunia internasional terus menyerukan penghentian kekerasan dan solusi damai. Dukungan kemanusiaan dari berbagai negara pun mengalir untuk meringankan beban saudara-saudara kita di Gaza.</p><p data-start=\"1727\" data-end=\"1912\" style=\"text-align: justify;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"21,000 Children Are Missing in Gaza, on Top of Over 15,000 Killed by Israel.jpeg\" style=\"width: 602.771px;\"><br></p><p>\r\n\r\n\r\n</p><p data-start=\"1917\" data-end=\"2059\">Mari kita doakan dan dukung perjuangan rakyat Palestina. Sebarkan informasi yang benar, hindari hoaks, dan jadilah bagian dari suara keadilan!</p>', 'defff4ecdee32b1e0e5072780b95fe5f.jpg', 7, 1, 1, 1, '2025-06-13 20:48:44', '2025-06-13 22:39:04', NULL);
INSERT INTO `posts` (`id`, `user_id`, `title`, `slug`, `category_id`, `content`, `thumbnail`, `views`, `is_featured`, `enable_comment`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(2, 1, 'Gaza Kembali Membara: Serangan Udara Menyasar Wilayah Sipil', 'gaza-kembali-membara-serangan-udara-menyasar-wilayah-sipil', 1, '<p data-start=\"205\" data-end=\"482\">Wilayah Gaza kembali menjadi target serangan udara pada Jumat dini hari. Menurut laporan dari Kementerian Kesehatan Palestina, sedikitnya 20 warga sipil, termasuk anak-anak dan perempuan, menjadi korban jiwa dalam rentetan serangan terbaru yang dilancarkan oleh militer Israel.</p><p data-start=\"484\" data-end=\"732\">Serangan ini menghantam permukiman padat penduduk di Khan Younis dan Beit Lahia, menyebabkan puluhan rumah hancur dan ratusan warga kehilangan tempat tinggal. Tim penyelamat masih terus mencari korban di bawah reruntuhan bangunan hingga siang hari.</p><p data-start=\"734\" data-end=\"1022\">Organisasi hak asasi manusia internasional kembali mengecam tindakan tersebut sebagai bentuk pelanggaran serius terhadap hukum humaniter. Amnesty International menyatakan bahwa penggunaan kekuatan militer terhadap wilayah sipil harus segera dihentikan dan diinvestigasi secara independen.</p><p data-start=\"734\" data-end=\"1022\"><img src=\"data:image/jpeg;base64,\" data-filename=\"Sinergi Foundation Salurkan Amanah Masyarakat Indonesia untuk Saudaranya di Jalur Gaza, Palestina - Sinergi Foundation.jpeg\" style=\"width: 602.771px;\"><br></p><p data-start=\"1024\" data-end=\"1281\">Di sisi lain, masyarakat dunia menunjukkan solidaritas melalui aksi damai dan penggalangan dana untuk membantu para korban di Gaza. Beberapa negara di Eropa bahkan mulai mendesak Dewan Keamanan PBB untuk segera menggelar sidang darurat terkait eskalasi ini.</p><p>\r\n\r\n\r\n\r\n</p><p data-start=\"1283\" data-end=\"1547\">Situasi di Gaza semakin memprihatinkan seiring blokade yang terus berlangsung dan minimnya akses terhadap kebutuhan dasar seperti air bersih, listrik, dan obat-obatan. Masyarakat internasional diharapkan tidak tinggal diam dalam menghadapi tragedi kemanusiaan ini.</p>', 'd14f4a89933a5dc6506cb81d0dfb99a2.jpg', 3, 1, 1, 1, '2025-06-13 20:56:52', '2025-06-13 22:38:40', NULL);
INSERT INTO `posts` (`id`, `user_id`, `title`, `slug`, `category_id`, `content`, `thumbnail`, `views`, `is_featured`, `enable_comment`, `status`, `created_at`, `updated_at`, `deleted_at`) VALUES
(3, 1, 'Peduli Gaza: Saatnya Dunia Bertindak, Bukan Hanya Menonton', 'peduli-gaza-saatnya-dunia-bertindak-bukan-hanya-menonton', 4, '<p data-start=\"298\" data-end=\"538\">Di tengah puing-puing bangunan dan suara sirine yang tak kunjung berhenti, warga Gaza terus berjuang mempertahankan hidup. Setiap hari, anak-anak bangun di bawah ancaman bom dan kekurangan makanan, sementara dunia menyaksikan dari kejauhan.</p><p data-start=\"540\" data-end=\"735\">Blokade berkepanjangan telah memutus akses terhadap kebutuhan dasar: air bersih, obat-obatan, dan listrik. Rumah sakit kewalahan, tim medis kelelahan, dan tidak ada tempat aman untuk bersembunyi.</p><p data-start=\"540\" data-end=\"735\"><img src=\"data:image/jpeg;base64,\" data-filename=\"Updates_ Israel kills dozens in Gaza; allies issue warning to halt assault.jpeg\" style=\"width: 602.771px;\"><br></p><p data-start=\"737\" data-end=\"952\">Saatnya kita bertindak. Tidak cukup hanya berempati. Kita bisa membantu melalui donasi kemanusiaan, menyebarkan informasi yang benar, serta menekan pemerintah dan lembaga internasional untuk mengambil langkah nyata.</p><p data-start=\"954\" data-end=\"1133\">Solidaritas global harus bersuara lantang. Gaza bukan hanya cerita konflik ‚Äî Gaza adalah tentang manusia yang ingin hidup layak. Mari satukan suara untuk keadilan dan kemanusiaan.</p><p>\r\n\r\n\r\n\r\n</p><p data-start=\"1135\" data-end=\"1200\"><strong data-start=\"1135\" data-end=\"1200\">‚ÄúPeduli Gaza bukan pilihan, tapi kewajiban moral kita semua.‚Äù</strong></p>', '8cce0819dfe4dff6a58f140f175220db.jpg', 6, 1, 1, 1, '2025-06-13 21:07:14', '2025-06-13 22:38:25', NULL);
